// import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      mm: 'jo'
    }
  }
  render() {
    return (
      <div className="App">
        <h1>{this.state.mm}</h1>
        <button onClick={() => this.setstate({ mm: 'test' })}></button>
      </div>
    )
  };
}

export default App;
